import ProgressBar from 'react-bootstrap/ProgressBar';

function WithLabelExample() {
  const now = 60;
  return <ProgressBar now={now} label={`${now}%`} style={{width: '20%', height: '100%'}}/>;
}



export default WithLabelExample;
